@aziz_carter There is no public evidence that Donald Trump directly offered Volodymyr Zelenskyy a deal to hand over 20% of Ukraine’s territory to Russia in exchange for security guarantees, or that the quoted conversation took place as described. 

Recent news coverage and fact checks confirm that Trump has highlighted or reposted social media posts and discussed security guarantee proposals—sometimes suggesting Ukraine might "lose some territory"—but any specific territorial decisions are being publicly framed as up to Ukraine, and no verifiable record of Trump using the phrase “What’s a constitution?” in talks with Zelenskyy exists.

For now, the widely circulated script in the quoted tweet appears to be a satirical or exaggerated depiction rather than a documented exchange.

